# --- 3. Session‐based stats (30-min inactivity break) ---
threshold = 30 * 60  # seconds

# Reset index to get datetime back as a column
df_sess = df.reset_index().sort_values(['ip', 'datetime'])

# Compute gap since previous request of same IP
df_sess['prev_dt'] = df_sess.groupby('ip')['datetime'].shift(1)
df_sess['gap_s']  = (df_sess['datetime'] - df_sess['prev_dt']).dt.total_seconds().fillna(threshold+1)

# Mark new session when gap > threshold
df_sess['new_sess'] = df_sess['gap_s'] > threshold
df_sess['session_id'] = df_sess['new_sess'].cumsum()

# Aggregate per session
session_stats = (
    df_sess
    .groupby('session_id')
    .agg(
        ip             = ('ip', 'first'),
        start_time     = ('datetime', 'min'),
        end_time       = ('datetime', 'max'),
        request_count  = ('request', 'count'),
        duration_s     = ('datetime', lambda x: (x.max() - x.min()).total_seconds()),
        unique_ips     = ('ip', 'nunique'),
        error_ratio    = ('status', lambda s: s.between(400, 599).sum() / s.count())
    )
)

# Requests per minute, guarding against zero‐duration sessions
session_stats['req_per_min'] = session_stats['request_count'] / (session_stats['duration_s'] / 60).replace(0, 1)

print("=== Session‐based stats ===")
print(session_stats.head())

