"""**Time-based aggregations** (For Traffic patterns, Bursty or anomalous behavior, Potential intrusions (DoS, scanning, brute force), Session profiling over time)"""

import pandas as pd
import numpy as np

# Load the Apache log dataset
df_timebased = pd.read_csv('/content/drive/MyDrive/LLM4Sec/Week3/apache_logs_labelled.csv', parse_dates=['datetime'])

# Ensure timestamps are sorted
df_timebased.sort_values('datetime', inplace=True)
df_timebased.set_index('datetime', inplace=True)

# ---- 1. Basic time-series per-second resampling ----
resampled = df_timebased.resample('1s').agg({
    'ip': 'nunique',
    'status': lambda x: ((x >= 400) & (x < 600)).sum() / len(x) if len(x) > 0 else 0,
    'request': 'count'
})
resampled.columns = ['unique_ip_count', 'error_ratio', 'request_count']

# ---- 2. Rolling mean and std over 1min, 5min, 1hr ----
windows = ['1min', '5min', '1h']
for window in windows:
    resampled[f'request_count_mean_{window}'] = resampled['request_count'].rolling(window).mean()
    resampled[f'request_count_std_{window}'] = resampled['request_count'].rolling(window).std()

    resampled[f'unique_ip_mean_{window}'] = resampled['unique_ip_count'].rolling(window).mean()
    resampled[f'unique_ip_std_{window}'] = resampled['unique_ip_count'].rolling(window).std()

    resampled[f'error_ratio_mean_{window}'] = resampled['error_ratio'].rolling(window).mean()
    resampled[f'error_ratio_std_{window}'] = resampled['error_ratio'].rolling(window).std()

# ---- 3. Burstiness: Inter-arrival time Coefficient of Variation ----
# Reset for inter-arrival computation
df_reset = df_timebased.reset_index().sort_values('datetime')

# Compute inter-arrival time (IAT)
df_reset['inter_arrival'] = df_reset['datetime'].diff().dt.total_seconds()
df_reset['inter_arrival'].fillna(0, inplace=True)

# Resample IAT to 1-minute windows and compute CV
iat_cv = df_reset.resample('1min', on='datetime')['inter_arrival'].agg(
    lambda x: np.std(x) / np.mean(x) if np.mean(x) > 0 else 0
).rename('burstiness_cv')

# Optional smoothing
iat_cv_smoothed = iat_cv.rolling(5).mean().rename('burstiness_cv_smoothed')

# ---- 4. Merge all time-based features ----
final_df = resampled.copy()
final_df = final_df.merge(iat_cv, left_index=True, right_index=True, how='left')
final_df = final_df.merge(iat_cv_smoothed, left_index=True, right_index=True, how='left')

# ---- 5. Save the output ----
final_df.to_csv('/content/drive/MyDrive/LLM4Sec/Week3/time_based_features.csv')
print("✅ Extracted and saved to: time_based_features.csv")

import pandas as pd
import numpy as np
from collections import Counter
from sklearn.preprocessing import normalize
import itertools

# Load your logs
df = pd.read_csv('/content/drive/MyDrive/LLM4Sec/Week3/apache_logs_labelled.csv', parse_dates=['datetime'])

# Sort and group by IP or session
df.sort_values(['ip', 'datetime'], inplace=True)

# --- STEP 1: Tokenize status codes into sequences per IP ---
status_sequences = df.groupby('ip')['status'].apply(list)

# --- STEP 2: Extract n-gram frequencies (e.g., bigrams) ---
def extract_ngrams(seq, n=2):
    return list(zip(*[seq[i:] for i in range(n)]))

all_bigrams = []

for seq in status_sequences:
    bigrams = extract_ngrams(seq, n=2)
    all_bigrams.extend(bigrams)

bigram_counts = Counter(all_bigrams)

# Convert to dataframe
bigram_df = pd.DataFrame(bigram_counts.items(), columns=['bigram', 'count'])
bigram_df[['from_status', 'to_status']] = pd.DataFrame(bigram_df['bigram'].tolist(), index=bigram_df.index)
bigram_df.drop(columns='bigram', inplace=True)

# --- STEP 3: Transition Matrix (Markov Model) ---
# Create a transition matrix: P(to_status | from_status)
trans_matrix = bigram_df.pivot_table(index='from_status', columns='to_status', values='count', fill_value=0)

# Normalize to get transition probabilities
trans_matrix_prob = normalize(trans_matrix, norm='l1', axis=1)
trans_matrix_prob_df = pd.DataFrame(trans_matrix_prob, index=trans_matrix.index, columns=trans_matrix.columns)

# Optional: save for inspection
trans_matrix_prob_df.to_csv('/content/drive/MyDrive/LLM4Sec/Week3/sequence_patterns_features.csv')

"""Entropy & diversity metrics: Shannon entropy

| Feature Name               | Use Case                                                         |
| -------------------------- | ---------------------------------------------------------------- |
| `url_entropy`              | High: scanners, fuzzers<br>Low: bots or crawlers                 |
| `user_agent_entropy`       | High: UA spoofing, rotating clients<br>Low: botnet using same UA |
| Combine with request count | e.g., 1000 reqs + low entropy → automated actor                  |
"""

import pandas as pd
import numpy as np
from collections import Counter
from math import log2

# Load your Apache log file
df = pd.read_csv('/content/drive/MyDrive/LLM4Sec/Week3/apache_logs_labelled.csv', parse_dates=['datetime'])

# Clean up: drop rows with missing 'ip', 'request', or 'browser'
df.dropna(subset=['ip', 'request', 'browser'], inplace=True)

# --- Extract only the path from the request string ---
# From: "GET /bkd_baru/... HTTP/1.1" → To: "/bkd_baru/..."
df['request_path'] = df['request'].str.extract(r'^(?:GET|POST|PUT|DELETE|HEAD)\s+(\S+)\s+HTTP')

# --- Entropy function ---
def shannon_entropy(items):
    total = len(items)
    if total == 0:
        return 0
    counts = Counter(items)
    probs = [count / total for count in counts.values()]
    return -sum(p * log2(p + 1e-10) for p in probs)

# --- Entropy per IP: URL path ---
url_entropy = df.groupby('ip')['request_path'].apply(shannon_entropy).reset_index()
url_entropy.columns = ['ip', 'url_entropy']

# --- Entropy per IP: User-Agent string (browser) ---
ua_entropy = df.groupby('ip')['browser'].apply(shannon_entropy).reset_index()
ua_entropy.columns = ['ip', 'user_agent_entropy']

# --- Merge both entropy features ---
entropy_features = pd.merge(url_entropy, ua_entropy, on='ip')

# Save result
entropy_features.to_csv('/content/drive/MyDrive/LLM4Sec/Week3/ip_entropy_features.csv', index=False)
print("✅ Saved entropy features to ip_entropy_features.csv")

