from ip2geotools.databases.noncommercial import DbIpCity
import pandas as pd
from tqdm.notebook import tqdm
import socket

# Load Apache log data (with 'ip' column)
df = pd.read_csv('/content/drive/MyDrive/LLM4Sec/Week3/apache_logs_labelled.csv')

# Store results
geolocated = []

# Remove duplicates to speed things up
unique_ips = df['ip'].dropna().unique()

for ip in tqdm(unique_ips):
    result = {'ip': ip}
    try:
        response = DbIpCity.get(ip, api_key='free')
        result.update({
            'country': response.country,
            'region': response.region,
            'city': response.city,
            'asn': response.asn if hasattr(response, 'asn') else None
        })
    except Exception as e:
        result.update({'country': None, 'region': None, 'city': None, 'asn': None})
    try:
        result['reverse_dns'] = socket.gethostbyaddr(ip)[0]
    except:
        result['reverse_dns'] = None
    geolocated.append(result)

# Create a DataFrame
geo_df = pd.DataFrame(geolocated)

# Merge back into logs
df_enriched = df.merge(geo_df, on='ip', how='left')

# Save result
df_enriched.to_csv('/content/drive/MyDrive/LLM4Sec/Week3/geolocation_enriched.csv', index=False)
print("✅ Enriched logs saved as geolocation_enriched.csv")

