#Load & Prepare Apache Logs

import pandas as pd

# Load original Apache data
df = pd.read_csv('/mnt/data/apache_logs_labelled.csv')

# Convert labels
df['label'] = df['detected'].map({
    'BAHAYA': 'Anomalous',
    'DICURIGAI': 'Anomalous',
    'AMAN': 'Normal'
})

# Create text column from log parts
df['log'] = df[['ip','datetime','request','status','referer','browser']]\
             .astype(str).agg(' '.join, axis=1)

df = df[['log', 'label']].dropna()

# Save processed full set
df.to_csv('/mnt/data/apache_logs_processed.csv', index=False)

#Balance the Dataset

# Balance classes for training
normal_sample = df[df['label'] == 'Normal'].sample(n=2000, random_state=42)
anomalous_sample = df[df['label'] == 'Anomalous'].sample(n=2000, random_state=42)
df_balanced = pd.concat([normal_sample, anomalous_sample]).sample(frac=1, random_state=42)

# Save balanced data
df_balanced.to_csv('/mnt/data/apache_logs_balanced.csv', index=False)

# Train DistilRoBERTa Classifier
from datasets import Dataset, DatasetDict
from transformers import (
    AutoTokenizer, AutoModelForSequenceClassification, Trainer,
    TrainingArguments, DataCollatorWithPadding
)
from sklearn.model_selection import train_test_split
import numpy as np
import evaluate

# Load and split
def load_and_split(path):
    df = pd.read_csv(path).dropna()
    df['label'] = df['label'].map({'Anomalous': 0, 'Normal': 1})
    train_df, test_df = train_test_split(df, stratify=df['label'], test_size=0.25, random_state=42)
    return DatasetDict({
        'train': Dataset.from_dict(train_df.to_dict('list')),
        'test':  Dataset.from_dict(test_df.to_dict('list'))
    })

ds = load_and_split('/mnt/data/apache_logs_balanced.csv')

# Tokenize
tok = AutoTokenizer.from_pretrained("distilroberta-base")
tokenized = ds.map(lambda x: tok(x['log'], truncation=True), batched=True)

# Model and Trainer
model = AutoModelForSequenceClassification.from_pretrained(
    "distilroberta-base",
    num_labels=2,
    id2label={0: "Anomalous", 1: "Normal"},
    label2id={"Anomalous": 0, "Normal": 1}
)

args = TrainingArguments(
    output_dir="apache_model",
    evaluation_strategy="epoch",
    save_strategy="epoch",
    load_best_model_at_end=True,
    per_device_train_batch_size=32,
    per_device_eval_batch_size=32,
    num_train_epochs=3,
    logging_steps=50,
    learning_rate=2e-5,
    weight_decay=0.01,
    report_to="none"
)

trainer = Trainer(
    model=model,
    args=args,
    train_dataset=tokenized["train"],
    eval_dataset=tokenized["test"],
    tokenizer=tok,
    data_collator=DataCollatorWithPadding(tok),
    compute_metrics=lambda p: evaluate.load("accuracy").compute(
        predictions=np.argmax(p.predictions, axis=1),
        references=p.label_ids
    )
)

trainer.train()

#Evaluation: Classification Report & ROC
import torch
from sklearn.metrics import classification_report, roc_curve, roc_auc_score
import matplotlib.pyplot as plt

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
model.to(device).eval()

# Collect predictions
probs, preds, labels = [], [], []

for ex in tokenized["test"]:
    inputs = tok(ex["log"], return_tensors="pt", truncation=True, padding=True).to(device)
    with torch.no_grad():
        logits = model(**inputs).logits.squeeze().cpu().numpy()
    prob = torch.softmax(torch.tensor(logits), dim=0)[1].item()
    pred = int(logits.argmax())
    probs.append(prob)
    preds.append(pred)
    labels.append(ex["label"])

# Classification report
print(classification_report(labels, preds, target_names=["Anomalous", "Normal"]))

# ROC curve
fpr, tpr, _ = roc_curve(labels, probs)
auc = roc_auc_score(labels, probs)
plt.figure()
plt.plot(fpr, tpr, label=f"DistilRoBERTa (AUC = {auc:.2f})")
plt.plot([0, 1], [0, 1], '--', color='gray')
plt.xlabel("False Positive Rate")
plt.ylabel("True Positive Rate")
plt.title("ROC Curve")
plt.legend()
plt.grid()
plt.show()

#Save Model
model.save_pretrained("/mnt/data/distilroberta-apache-finetuned")
tok.save_pretrained("/mnt/data/distilroberta-apache-finetuned")

